import styled from '@emotion/styled'

// const StyleText = styled.p`
//     border: 1px solid ${props => props.theme.colors.primary}
// `

const StyleText = styled.p`
    border: 1px solid ${props => props.theme.colors.primary}
`
const func = () => {
    return <StyleText>Some text</StyleText>
}
// const StyleText = () => <p>Some text</p>

// export default StyleText
export default () => func
